part of 'cart_bloc.dart';abstract class CartEvent extends Equatable {  const CartEvent();}class CartInitEvent extends CartEvent{  final Order order;  const CartInitEvent(this.order);  @override  List<Object?> get props => [];}class CartOrderEvent extends CartEvent{  final Order order;  const CartOrderEvent(this.order);  @override  List<Object?> get props => [];}class CartSendtEvent extends CartEvent{  final Order order;  const CartSendtEvent(this.order);  @override  List<Object?> get props => [];}class CartAddEvent extends CartEvent{  @override  List<Object?> get props => [];}class CartRemoveEvent extends CartEvent{  @override  List<Object?> get props => [];}class CartRequestEvent extends CartEvent{  final String name;  final String phone;  const CartRequestEvent({required this.phone,required this.name});  @override  List<Object?> get props => [];}